import React from 'react';
import ModalKa from './Modal';

export default function home(props) {
  function modal() {
    return <ModalKa />;
  }

  return (
    <div className='div-table'>
      <table className='w-75 container table table-striped table-dark'>
        <tbody>
          {props.questions.map((item) => {
            return (
              <tr>
                <th scope='row' key={item._id}>
                  {item.theme}
                </th>
                {item.questions.map((question, index) => {
                  return (
                    <td
                      key={item._id + index}
                      onClick={() => {
                        modal;
                      }}
                    >
                      {question.points}
                    </td>
                  );
                })}
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
